import { InputLabel, MenuItem, Select } from "@mui/material";
import React from "react";
import {ChangeFilterType} from "../types/methods.type";
import {allFilters, FilterProperty} from "../types/searchFilters.type";
import {FormControl} from "./formControl.component";

export function FilterPropertySelect({filterProperty, changeFilterType}:{filterProperty:FilterProperty|null, changeFilterType: ChangeFilterType}) {
    return <FormControl>
        <Select
            value={filterProperty}
            onChange={(e)=>changeFilterType(e.target.value as FilterProperty)}
        >
            {allFilters.map(f=><MenuItem value={f}>{f}</MenuItem>)}
        </Select>
    </FormControl>;
}
